const NavBar = () => { 
    return (

    <ul>
        <li>
            <a className="waterMark" href="/">Hassan&Devon Inc</a>
            <a className="templates" href="/templates">Templates</a>
            <a className="login" href="/login">Log In</a>
            <a className="register" href="/signup">Sign Up</a>
        </li>
    </ul>
        


    )
}


export default NavBar
